import React from 'react';

const Card = (props) => {
    return (
      <div className='tc bg-light-green dib br3 pa3 ma2 grow'>
        <img alt='robo' src='https://robohash.org/test?size=200x200'></img>
        <div>
          <h2>{props.name}</h2>
          <p>{props.email}</p>
        </div>
      </div>
    );
}
export default Card;
